import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader
import { Carousel } from 'react-responsive-carousel';
import Radio from './Radio';

export class RadioButtonCarousel extends Component{
    handleEventChange = (e) => {
        Radio.checked = (e === false) ? true : false;
     }

    render(){
        return(
            <Carousel>
                <div>
                    <h3> Select choice </h3>
                    <Radio name="Selected Radio Button" value="select"/>
                    <br/>
                    <Radio name="Selected Radio Button" value="select"/>
                    <br/>
                    <Radio name="Selected Radio Button" value="select"/>
                    <br/>
                    <Radio name="Selected Radio Button" value="select" checked={false} disabled ={false}/>
                    <br/>
                    <Radio name="Selected Radio Button" value="select"/>
                </div>
            </Carousel>

        )
    }
}
